# 6304. Maximum Number of Integers to Choose From a Range I
# https://leetcode.com/contest/biweekly-contest-97/problems/maximum-number-of-integers-to-choose-from-a-range-i/

import itertools
import time
from typing import List


class Solution:
    def maxCount(self, banned: List[int], n: int, maxSum: int) -> int:
        res = 0
        s = 0
        arr = []
        granted_set = set(range(1, n+1, 1))-set(banned)
        for x in sorted(granted_set):
            if (s+x <= maxSum):
                arr.append(x)
                s += x
                res += 1
        return res


def test(arg1, arg2, arg3, arg_res):
    res = sol.maxCount(arg1, arg2, arg3)
    if res == arg_res:
        print("OK", res, "==", arg_res)
    else:
        print("--", res, "==", arg_res)



